import { GET_DATA } from "./types"
import { data } from "../../components/utlis/data"

export const getCurrentProfile = () => dispatch => {
  dispatch(setProfileLoading())
  axios
    .get("/api/profile")
    .then(res =>
      dispatch({
        type: GET_PROFILE,
        payload: res.data
      })
    )
    .catch(err =>
      dispatch({
        type: GET_PROFILE,
        payload: {}
      })
    )
}
